settings._cssCustom:
/* Clickable Parent */

.fr-schedule-card-alpha {
	position: relative;
}

.fr-schedule-card-alpha__button::after {
	content: '';
  position: absolute;
  inset: 0;
  display: flex;
  z-index: 1;
}

/* Focus Parent */

.fr-schedule-card-alpha:focus-within :focus {
	outline: none;
  box-shadow: none;
}

.fr-schedule-card-alpha:focus-within {
	box-shadow: 0 0 0 var(--focus-width) var(--focus-color);
}

/* NOTICE: Schedule card order & mobile stacking order will NOT show properly in the builder until Bricks fixes the bug related to data attribute styling showing in canvas. Check the front-end for accurate visual reference. */

.fr-schedule-alpha {
  --column-width: 320px;
	--column-gap: calc(var(--content-gap) * 2.5);
  --row-gap: calc(var(--content-gap) / 2);
  --divider-width: 1px;
  --divider-color: var(--neutral-dark-trans-10);
  --scroll-track-color: var(--black-trans-10);
  --scroll-thumb-color: var(--black-trans-10);
  --scroll-thumb-color-hover: var(--primary);
}

/* Inner wrapper required to support border radius
when using scrollbars. */

.fr-schedule-alpha__inner {
  display: grid;
  grid-template-columns: var(--grid-1);
  gap: var(--row-gap) var(--column-gap);
  grid-auto-flow: dense; /* No Touchey */
  overflow: scroll hidden;
  padding: calc(var(--column-gap) / 2);
}

/* Create grid layout 
at desired breakpoint & up */

@media (min-width: 991px) {
  .fr-schedule-alpha__inner {
  	grid-template-columns: repeat(7, minmax(var(--column-width), 1fr));
  }
  .fr-schedule-alpha [data-schedule-column="monday"] {
    grid-column: 1;
	}
  .fr-schedule-alpha [data-schedule-column="tuesday"] {
    grid-column: 2;
  }
  .fr-schedule-alpha [data-schedule-column="wednesday"] {
    grid-column: 3;
  }
  .fr-schedule-alpha [data-schedule-column="thursday"] {
    grid-column: 4;
  }
  .fr-schedule-alpha [data-schedule-column="friday"] {
    grid-column: 5;
  }
  .fr-schedule-alpha [data-schedule-column="saturday"] {
    grid-column: 6;
  }
  .fr-schedule-alpha [data-schedule-column="sunday"] {
    grid-column: 7;
  }

}

/* Control stacking order on mobile */

.fr-schedule-alpha [data-schedule-column="monday"] {
  order: 0;
}
.fr-schedule-alpha [data-schedule-column="tuesday"] {
	order: 1;
}
.fr-schedule-alpha [data-schedule-column="wednesday"] {
  order: 2;
}
.fr-schedule-alpha [data-schedule-column="thursday"] {
  order: 3;
}
.fr-schedule-alpha [data-schedule-column="friday"] {
  order: 4;
}
.fr-schedule-alpha [data-schedule-column="saturday"] {
  order: 5;
}
.fr-schedule-alpha [data-schedule-column="sunday"] {
  order: 6;
}

/* Scroll bar styling */

/* Width and color of the scrollbar for WebKit */

.fr-schedule-alpha__inner::-webkit-scrollbar {
	width: auto;
}

.fr-schedule-alpha__inner::-webkit-scrollbar-track {
  background: var(--scroll-track-color);
}

.fr-schedule-alpha__inner::-webkit-scrollbar-thumb {
  background: var(--scroll-thumb-color);
}

.fr-schedule-alpha__inner::-webkit-scrollbar-thumb:hover {
  background: var(--scroll-thumb-color-hover);
}

/* Width and color of the scrollbar for Firefox */
.fr-schedule-alpha {
  scrollbar-width: thin;
  scrollbar-color: var(--scroll-track-color) var(--scroll-thumb-color);
}

@media (min-width: 991px) {
  .fr-schedule-alpha__column-heading-wrapper:not(:nth-child(7))::after {
    content: '';
    position: absolute;
    width: var(--divider-width);
    height: 1000vh;
    background: var(--divider-color);
    right: calc(var(--column-gap) / 2 * -1);
    top: calc(var(--column-gap) / 2 * -1);
  }
}
